      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n \n  \u003Cdiv style=\"width: 90%;\"\u003E\n      \n    \u003Ch2\u003EInštrukcie\u003C\u002Fh2\u003E\n    \n    \u003Cp class=\"text-left\"\u003ETento experiment sa zaoberá tým, ako ľudia spracúvajú slová. Budete požiadaní, aby ste si pozreli slová a posúdili ich.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003ESlová budú zobrazené uprostred obrazovky. Mali by ste si položiť otázku, či slovo na obrazovke je skutočné slovo alebo vymyslené slovo. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EAk rozpoznáte na obrazovke skutočné slovo ako napr. \u003Cb\u003ECHLAD\u003C\u002Fb\u003E, stlačte tlačidlo \u003Ckbd\u003E${ window.word_key }\u003C\u002Fkbd\u003E pre skutočné slovo. Ak je slovo vymyslený nezmysel, napríklad \u003Cb\u003EVERM\u003C\u002Fb\u003E, stlačte kláves \u003Ckbd\u003E${ window.nonword_key }\u003C\u002Fkbd\u003E pre vymyslené slovo. Počas cvičenia vám poskytneme spätnú väzbu.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EChceli by sme vás požiadať, aby ste reagovali čo najrýchlejšie a zároveň zostali presní. Na odpoveď na každé slovo máte tri sekúnd. \u003C\u002Fp\u003E\n  \n  \u003C\u002Fdiv\u003E\n\n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Stlačte prosím \u003Ckbd\u003EMEDZERNÍK\u003C\u002Fkbd\u003E a vyskúšajte si niekoľko cvičných slov.\n\u003C\u002Ffooter\u003E",
